import { cineDTO } from "../cines/cines.model";
import { generoDTO } from "../generos/generos.model";
import FormularioPeliculas from "./FormularioPeliculas";

export default function EditarPeliculas() {
  const generosNoSeleccionados: generoDTO[] = [{ id: 2, nombre: "Drama" }];
  const generosSeleccionados: generoDTO[] = [
    { id: 1, nombre: "Acción" },
    { id: 3, nombre: "Comedia" },
  ];

  const cinesSeleccionados: cineDTO[] =[
    { id: 2, nombre: "Royal Films" }
  ];

  const cinesNoSeleccionados: cineDTO[] =[
    { id: 1, nombre: "Cine Colombia" }
  ];

  return (
    <>
      <h3>Editar Película</h3>

      <FormularioPeliculas
        modelo={{
          titulo: "Sipder-Man",
          enCines: true,
          trailer: "url",
          fechaLanzamiento: new Date("2019-01-01T00:00:00"),
        }}
        onSubmit={(valores) => console.log(valores)}
        generosNoSeleccionados={generosNoSeleccionados}
        generosSeleccionados={generosSeleccionados}
        cinesSeleccionados={cinesSeleccionados}
        cinesNoSeleccionados={cinesNoSeleccionados}
      />
    </>
  );
}
